import PropTypes from "prop-types";

const MedicalFeature = ({ data }) => {
    return (
        <div className="content">
            <h5 className="title">{data.title}</h5>
            <p>{data.content}</p>
        </div>
    );
};

MedicalFeature.propTypes = {
    data: PropTypes.object,
};

export default MedicalFeature;
